import axios from 'axios';


const getAllSalaries = () => {
    return axios.get(`/salaries`, {
        headers: {
            'Content-Type': 'application/json'
        },
    });
}

const SalariesScreen = {
    getAllSalaries
}

export default SalariesScreen;
